import './App.css';
import Products from "./components/Products";
import { Provider } from "react-redux";
import store from "./store";

class App extends React.Component {
  render() {
    return (
      <Provider store={store}>
<div className="container">
      <div className="App">
        <h1>Shopping Bonanza</h1>
        <Products />
      </div>
      </div>
      </Provider>
    );
  }

}

export default App;
